INSERT INTO `products` VALUES (20,'Yamaha MT 15 Trident Crash Guard Mat Slider','This MT 15 crash guard can protect your motorcycle during an event of an accident or crash. This Crash guard is strongly built with additional sliders on the sides and gives added protection to your motorcycle. The stylish and sporty design of the product adds an aesthetic touch to your motorcycle.',2499.00,5,4,'MT Slider.png',5,NULL),(21,'Yamaha MT 15 Expedition Carrier','Presenting specially designed back rack for Yamaha MT15. This is a simple and stylish rear carrier that lets you carry and mount additional luggage when commuting or when riding long distances. The design makes all the difference. It neither disturbs your pillion rider nor feels any inconvenience in riding. The product featured here is made with high-grade mild steel.',999.00,5,11,'MT Expedition.png',5,NULL),(22,'Yamaha MT Trail Carrier','Carrying extra luggage on motorcycles is a hassle but the Yamaha MT 15 trail carrier can solve this for you. With a sleek finish and quality build, this carrier is designed to last. When you decide to take your naked street fighter to the open roads, our trail carrier is your trusted sidekick.',999.00,5,2,'MT Trail.png',5,NULL),(23,'Yamaha MT 15 Frame Slider','Frame sliders minimize the damage to the frame (around the engine) and the fairing of the bike. Even a fall so minor could damage your fairing.  Replacing the fiber (or plastic) parts after a crash is expensive. So, keep your motorcycle as good as new after a fall, with these frame sliders! These Frame Sliders are sturdy and lightweight at the same time. It also has the added advantage of being highly abrasive. Therefore, if you fall off while riding, it sacrifices itself to a certain extent and absorbs the crash impact.',1499.00,5,25,'MT Frame Slider.png',5,NULL),(25,'Yamaha MT 15 Short Visor Matt Black','The short visor is designed to make your bike look sleeker than what Yamaha intended to do. With the short build and the matte or glossy black finish, the visor slots in easily onto the vehicle accenting its look. The visor is made from corrosion-resistant material and built to last the seasons and the elements. This short visor is custom-built for MT-15. You don’t have to worry about adaptors, tapes and nuts and bolts. The visor is precision cut to slot in easily onto your MT-15.',199.00,5,25,'MT Short Visor.png',5,NULL),(26,'Yamaha MT 15 Metal Visor','Give your Yamaha bike an edgy makeover! Get your MT 15 a cool upgrade with our sleek and stylish metal visor. With a metallic finish and elegant design, these visors are just what your two-wheeled buddy needs to turn everyone’s eyes. They are durable and built to last longer and, above all, make your bike the centre of everyone’s attention as you enter a parking area. Our metal visor can ensure you double the functionality of a normal windscreen by blocking more wind than usual shielding. Being one of the popular options for comfort riding, you will be availed with a lasting design along with your safe ride. Enjoy your ride with the cold wind with protection against bugs and frost.',299.00,5,25,'MT Metal Visor.png',5,'[]'),(27,'Yamaha MT 15 Radiator Grill','The radiator grill delivers a powerful performance. It keeps your radiator safe from debris and additional damage.',799.00,5,25,'MT Radiator Grill.png',5,NULL),(28,'Yamaha MT 15 Tail Tidy','The Yamaha MT 15 Tail Tidy makes your bike more naked and minimal. It gives the tail light a stylish new abode. Made with lightweight mild steel, this product reduces the clutter, improves the aesthetics and ensures performance.',799.00,5,25,'MT Tail Tidy.png',5,NULL),(29,'Yamaha MT 15 Bend Pipe','If you have always wanted better sound and performance from your Yamaha, then look no further. Our aftermarket bend pipe is designed to give out optimal airflow through the exhaust thus generating better performance output. Pair this with a good quality slip-on exhaust to make your motorcycle the best sounding and performing motorcycle. The product featured here is designed for Yamaha MT15. The material used in manufacturing is stainless steel and the material makes it resistant towards rusting. This performance oriented product is a direct fit product and comes with easy installation.',1699.00,5,25,'MT Bend Pipe.png',5,NULL),(30,'Yamaha MT 15 Winglet','Upgrade your Yamaha MT 15 with this winglet to set yourself apart. It is sleek, stylish and sporty. Built to withstand wind blast even at high speeds! It comes with an elongated reflective surface giving you a better rear view. New-age sporty aesthetic meets durability in this winglet.',99.00,5,25,'MT Winglet.png',5,NULL),(31,'Yamaha MT 15 Carbon Metal Lever Guard','The Mission is to protect the rider’s hands, avoid accidental breakage of the lever in the event of impact and reduction of air pressure against the brake control even at high speed. The device ensures the brake lever system offers additional protection for the little finger. The outer part features a curved shape, making it easy to remove the hand quickly in the event of a high side.',299.00,5,25,'MT Metal Lever Guard.png',5,NULL),(32,'Yamaha MT 15 Tail Light','On dark and foggy nights, increase your visibility for other riders on road with the Integrated LED Tail Light 1.0 For Yamaha MT15. With a durable design, you can be assured that the light is your companion for many rides in the future.',2999.00,5,25,'MT Tail Light.png',5,NULL),(33,'Yamaha MT 15 Rolon Chain Sprocket','Rolon Brass Chain Sprocket Kit For MT 15',2499.00,5,25,'MT Chain Sprocket.png',5,NULL),(34,'Yamaha R15 V2 Bubble Visor','Visors are necessary accessories for your motorcycle, making it easy to ride through windy areas, which is why we have the perfect visor for your YAMAHA R15 V2. This bubble visor is durable and simply gives your motorcycle a facelift. The aerodynamic bubble design ensures proper airflow which results in better wind protection and ride quality.',299.00,5,25,'V2 Bubble Visor.png',5,NULL),(35,'Yamaha R15 V2 Metal Lever Guard','The Mission is to protect the rider’s hands, avoid accidental breakage of the lever in the event of impact and reduction of air pressure against the brake control even at high speed. The device ensures the brake lever system offers additional protection for the little finger. The outer part features a curved shape, making it easy to remove the hand quickly in the event of a high side.',299.00,5,25,'V2 Metal Lever Guard.png',5,NULL),(36,'Yamaha R15 V2 Carbon Mirror with Led','Enhance your Yamaha R15 V2 with this sleek and stylish Carbon Mirror featuring integrated LED indicators. Crafted from high-quality carbon fiber, these mirrors are designed to provide a lightweight and durable solution for your motorcycle. The carbon fiber finish adds a touch of sophistication and a sporty edge to your bike, perfectly complementing its aggressive design.',999.00,5,25,'V2 Mirror with Led.png',5,NULL);
